import axios from "axios";
import { onMounted, ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = () => {
    axios.get(apiUrl+"calendar/week")
      .then(res => res.data).then(resJson => {
      apiData.value = resJson;
    });
  }
  apiCall();

  return {
    apiData
  }
}
